type ProjectSnippetProps = {
    projectLink : string, 
    projectTitle : string, 
    projectImage : string
}

const ProjectSnippet = (props : ProjectSnippetProps) => {
    return (
        <a className="projectSnippetLink" href={props.projectLink}>
            <img src={`require(${props.projectImage})`} alt={props.projectTitle}></img>
            <div 
                className="projectSnippet" 
                style={{backgroundImage : `url(require(${props.projectImage})`}}>

            <h3>{props.projectTitle}</h3>

            </div>
        </a>
    )
}

export default ProjectSnippet;
